import * as React from 'react';
import PropTypes from 'prop-types';
import DictionaryAPIS from 'LIB/coi-apis/DictionaryAPIS';

function App() {
  const dict = new DictionaryAPIS({locale: 'en', country: 'US'})
console.log(dict);
  return (
    <React.Fragment>
      <h1>coi-common-ui</h1>
      <h3>Cisco One Identity Common User Interface</h3>
      <code>{`DictionaryAPIS - ${JSON.stringify(dict)}`}</code>
    </React.Fragment>
  );
}

App.propTypes = {
  title: PropTypes.string
};

export default App;
